import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

const data = {
  buttonInfo: {
    buttonText: 'Button',
    customText: 'You have clicked button',
  }

}

ReactDOM.render(
  <App buttonInfo={data}/>,
  document.getElementById('my-jsx-element')
);

serviceWorker.unregister();
